import React from "react";
import Employee from "./Employee";
import NewEmployee from "./NewEmployee";

const Employees = (props) => {
  return (
    <div>
      <NewEmployee></NewEmployee>
      <Employee></Employee>
    </div>
  );
};

export default Employees;
